import styled from "@emotion/styled";

export const HeaderWrapper = styled.header`
  height: 100vh;
  width: 100px;
  position: fixed;
  left: 0;
  display: flex;
  flex-direction: column;

  a {
    color: white;
    font-family: sans-serif;
  }
`;
